Digital Anarchy 3D Invigorator

Invigorator for Photoshop will allow you to create 3D objects instantly with our 3D text tool, as well as the ability to create 3D primitives. With the option to open Adobe Illustrator files, you can extrude logos that you design with just a few clicks.

The 3D Invigorator allows you to drag and drop materials to easily colour your objects. In addition, you can apply texture maps, bump maps, and even reflection maps for another level of realism. All objects can be customized by adding bevels, adjusting depth, or adjusting the edges.

Combine the modeling capabilities of 3D Invigorator with the power of Photoshop. With the 3D Invigorator for Photoshop, youll be able to give your designs an unfair advantage.

